💬 TCHAT | #Ukraine 
@mandraud : « La Transnistrie fait partie des conflits nés lors de la chute de l’URSS, comme celui du Haut-Karabakh, par exemple. On les a appelés « conflits gelés » en raison de leur persistance, sans reprise des hostilités. »
https://t.co/OUCVR6wQlb

💬 TCHAT | #Ukraine 
@mandraud : « La Moldavie, ancienne république soviétique, ne fait partie ni de l’Union européenne (UE) ni de l’OTAN. Sa déstabilisation entraînerait pourtant de graves conséquences pour toute la région. »
https://t.co/NAzYqrT6Ic

💬 TCHAT | #Ukraine 
@mandraud : «  Néanmoins, depuis l’annexion de la Crimée par la Russie en 2014, et surtout depuis le début de la guerre actuelle en Ukraine, les relations se sont interrompues. »
https://t.co/N318QSH7QS

💬 TCHAT | #Ukraine 
@mandraud : « La Transnistrie possède sa propre armée, en coopération avec les forces russes présentes sur son territoire. La population était jusqu’ici très proche des Ukrainiens »
https://t.co/N318QSH7QS

@mandraud 💬 TCHAT | #Ukraine 
@mandraud : « La Transnistrie s’est séparée de la Moldavie lors de la chute de l’URSS. Depuis, ce territoire vit sous protectort russe. On peut donc dire que cette enclave est effectivement prorusse. »
https://t.co/cAxyhZxWOV

